script: |
  super -f text -I q3545.spq | sort > q3545.out

inputs:
  - name: q3545.spq
    data: |
      SELECT DISTINCT - 16 * + col1 AS col1, + ( - 60 ) / col1 + col0 + - 48 AS col2 FROM tab0 (FORMAT parquet);
  - name: tab0

outputs:
  - name: q3545.out
    data: |
      -1296	-33
      -16	-11
      -336	37
